import React from "react";
import './index2.css'

const Incredecre = () => {
  return (
    <>
      <div className="container">
        <div id="card">
            <h1></h1>
            <button>Incre</button>
            <button>Decre</button>
        </div>
      </div>
    </>
  );
};

export default Incredecre;
